import Student from "./components/Student"


const App = () => {
  return (
    <div>
      <Student name="spongebob" age={30} isStudent={true}/>
      <Student name="patrick" age={42} isStudent={false}/>
      <Student name="sandy" age={22} isStudent={true}/>
      <Student/>
   </div>
  )
}

export default App
